style.css:
@-moz-document domain("kamoney.com.br") {
/* header */
.header {
    background: #212529!important;
    border-bottom: 1px solid #444444;

}

/* sidebar */
.sidebar {
    background: #212529!important;
}

/* below sidebar */
.sidebar ul.ul-bottom {
    background: #212529!important;
}

/* footer */
#app, .app_container {
    background-color: #212529!important;
}

/* around table */
main .page {
    background-color: #212529!important;
}

/* table text-color */
.table, .offcanvas .h5, .offcanvas h5, main .page .bg-page .h1, main .page .bg-page h1, .sidebar ul li a, .sidebar ul li ul li a, .offcanvas.offcanvas-large.offcanvas-balance .h3, .offcanvas.offcanvas-large.offcanvas-balance h3, main .page .home-balance .h1, main .page .home-balance h1, main .page .home-balance .h2, main .page .home-balance h2, main .page .title.h1, main .page h1.title, .table thead th, .offcanvas.offcanvas-large.offcanvas-balance .card-info .h3, .offcanvas.offcanvas-large.offcanvas-balance .card-info h3, .offcanvas.offcanvas-large.offcanvas-balance .card-info .h1, .offcanvas.offcanvas-large.offcanvas-balance .card-info h1, .card-serv a span, .ulinfo li, .form-label, .breadcrumb .breadcrumb-item a, .list .line.line-total .h6, .list .line.line-total h6, .list .line .h6, .list .line h6, .list .line.line-subtotal .h5, .list .line.line-subtotal h5, label.card-radio .card-input .panel-body .h3, label.card-radio .card-input .panel-body h3, label.card-radio .card-input .panel-heading .h1, label.card-radio .card-input .panel-heading h1, label.card-radio .card-input .panel-heading .h2, label.card-radio .card-input .panel-heading h2, .offcanvas .h2, .offcanvas h2, .list .line.line-cupom .h6, .list .line.line-cupom h6, .form-check-label, .invoice .h5, .invoice h5, .invoice .h3, .invoice h3, .invoice .card-info .h3, .invoice .card-info h3, .invoice .card-info .h1, .invoice .card-info h1, .offcanvas.offcanvas-large .h3, .offcanvas.offcanvas-large h3, .offcanvas.offcanvas-large .h2, .offcanvas.offcanvas-large h2, body, main .page .bg-page .h3, main .page .bg-page .qr.h3, main .page .bg-page h3, main .page .bg-page h3.qr {
    color: #fff;
}

/* inside table bg */
main .page .bg-page, main .page .home-balance, .card-serv a, label.card-radio .card-input, .invoice, .crypto {
    background: #2b3035 !important;
    box-shadow: unset;
    border: 1px solid #444444;
}

.trclick:hover {
    background: #424951 !important;
}

/* table bordered */
.table.table-one-two tbody tr:nth-child(2n) {
    background: #2b3035 !important;
}

.offcanvas {
    background: #212529!important;
}

main .marque-placard {
    visibility: hidden;
}

.offcanvas.offcanvas-large.offcanvas-balance .card-info {
    border: 1px solid #444444;
}

.nav-tabs {
    border-bottom: 1px solid #444444;
}

.nav-tabs .nav-item.show .nav-link, .nav-tabs .nav-link.active {
    background-color: #494949;
}

.form-control, .form-select, .form-control:disabled, .form-control[readonly], .form-search input, .form-search input:active, .form-search input:focus, .form-search input:hover, .form-control:focus, .form-select:disabled, .dp__input, .form-control.select-historico, .form-select.select-historico, .multiselect-search {
    color: #fff;
    background-color: #4a5159;
    border: 1px solid #444444;
}

.bg-white {
    box-shadow: unset;
    background: #2b3035 !important;
    border: 1px solid #444444;
    color: #fff;
}

.list {
    border-bottom: 1px solid #444444;
}

.invoice .card-info, .crypto-list {
    border: 1px solid #444444;
}
}
